import React from 'react';
import { Button, Backdrop, AppBar, Box } from '@material-ui/core';
import ButtonAppBar from '../components/buttonAppBar';
import { withStyles, responsiveFontSizes } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';

const WrapperBox = withStyles({
  root: {
    background: '#92cfcf',
    width: '100%',
    height: '1000px',
    display: "flex",
  },
})(Box);

const StyledBoxBlue = withStyles({
  root: {
    background: '#92cfcf',
    width: '100%',
    height: '100%',
    display: "flex",
    position: "absolute",
    top: 0, left: 0, right: 0, bottom: 0,
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '-50px',
    color: "white",
    fontSize: "60px",
    fontFamily: "Arial, Helvetica, sans-serif"
  },
})(Box);

const StyledBoxWhite = withStyles({
  root: {
    background: '#FFFFFF',
    width: '100%',
    height: '100%',
    display: "flex",
    position: "absolute",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '-50px',
    color: "white",
    fontSize: "60px",
    fontFamily: "Arial, Helvetica, sans-serif"
  },
})(Box);


const StyledButton = withStyles({
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);


const App = () => <WrapperBox><ButtonAppBar /><StyledBoxBlue><h2>Save Wearable Charity</h2></StyledBoxBlue><StyledBoxWhite></StyledBoxWhite></WrapperBox>;

export default App;
